import React from 'react';

function Header() {
  return (
    <header>
      <h1>Space Ventures</h1>
      <nav>
        <ul>
          <li><a href="#about">О нас</a></li>
          <li><a href="#services">Услуги</a></li>
          <li><a href="#contact">Контакты</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
